description:
Teach Yourself VISUALLY Excel 2010

If youre always hearing about the cool things that Microsoft Excel 2010 can do, heres your chance to see how to do them! With pages of full-colour, step-by-step instructions and crystal-clear screen shots, this guide shows you how to get the most out of Microsoft Excel 2010. The book covers all the basics as well as Microsoft Excel 2010s new features and functions, including a new interface and better collaboration tools. Crunch and chart your data over a network, over the Web, or at home-helpful tips on every page will get you there even faster!

Provides a clear look at Microsoft Excel 2010, the newest version of the worlds leading spreadsheet application from Microsoft, and part of the new Microsoft Office 2010 suite

Demonstrates how to create spreadsheets and charts, filter and sort data, work with PivotTable, and present your data-on a network, on the Web, or on your laptop

Explores all features and functions in full-colour pages packed with screen shots and other visual graphics that clearly show you how to accomplish tasks

Includes practical examples, tips, and advice on how to use all the tools more effectively

